sympy.sympy.core.cache.wrapper:
@wraps(func)
def wrapper(*args, **kwargs):
    try:
        retval = cfunc(*args, **kwargs)
    except TypeError as e:
        if not e.args or not e.args[0].startswith('unhashable type:'):
            raise
        retval = func(*args, **kwargs)
    return retval

sympy.sympy.core.mul.as_real_imag:
def as_real_imag(self, deep=True, **hints):
    from sympy.functions.elementary.complexes import Abs, im, re
    other = []
    coeffr = []
    coeffi = []
    addterms = S.One
    for a in self.args:
        r, i = a.as_real_imag()
        if i.is_zero:
            coeffr.append(r)
        elif r.is_zero:
            coeffi.append(i*S.ImaginaryUnit)
        elif a.is_commutative:
            aconj = a.conjugate() if other else None
            # search for complex conjugate pairs:
            for i, x in enumerate(other):
                if x == aconj:
                    coeffr.append(Abs(x)**2)
                    del other[i]
                    break
            else:
                if a.is_Add:
                    addterms *= a
                else:
                    other.append(a)
        else:
            other.append(a)
    m = self.func(*other)
    if hints.get('ignore') == m:
        return
    if len(coeffi) % 2:
        imco = im(coeffi.pop(0))
        # all other pairs make a real factor; they will be
        # put into reco below
    else:
        imco = S.Zero
    reco = self.func(*(coeffr + coeffi))
    r, i = (reco*re(m), reco*im(m))
    if addterms == 1:
        if m == 1:
            if imco.is_zero:
                return (reco, S.Zero)
            else:
                return (S.Zero, reco*imco)
        if imco is S.Zero:
            return (r, i)
        return (-imco*i, imco*r)
    from .function import expand_mul
    addre, addim = expand_mul(addterms, deep=False).as_real_imag()
    if imco is S.Zero:
        return (r*addre - i*addim, i*addre + r*addim)
    else:
        r, i = -imco*i, imco*r
        return (r*addre - i*addim, r*addim + i*addre)

sympy.sympy.core.power.as_real_imag:
def as_real_imag(self, deep=True, **hints):
    if self.exp.is_Integer:
        from sympy.polys.polytools import poly

        exp = self.exp
        re_e, im_e = self.base.as_real_imag(deep=deep)
        if not im_e:
            return self, S.Zero
        a, b = symbols('a b', cls=Dummy)
        if exp >= 0:
            if re_e.is_Number and im_e.is_Number:
                # We can be more efficient in this case
                expr = expand_multinomial(self.base**exp)
                if expr != self:
                    return expr.as_real_imag()

            expr = poly(
                (a + b)**exp)  # a = re, b = im; expr = (a + b*I)**exp
        else:
            mag = re_e**2 + im_e**2
            re_e, im_e = re_e/mag, -im_e/mag
            if re_e.is_Number and im_e.is_Number:
                # We can be more efficient in this case
                expr = expand_multinomial((re_e + im_e*S.ImaginaryUnit)**-exp)
                if expr != self:
                    return expr.as_real_imag()

            expr = poly((a + b)**-exp)

        # Terms with even b powers will be real
        r = [i for i in expr.terms() if not i[0][1] % 2]
        re_part = Add(*[cc*a**aa*b**bb for (aa, bb), cc in r])
        # Terms with odd b powers will be imaginary
        r = [i for i in expr.terms() if i[0][1] % 4 == 1]
        im_part1 = Add(*[cc*a**aa*b**bb for (aa, bb), cc in r])
        r = [i for i in expr.terms() if i[0][1] % 4 == 3]
        im_part3 = Add(*[cc*a**aa*b**bb for (aa, bb), cc in r])

        return (re_part.subs({a: re_e, b: S.ImaginaryUnit*im_e}),
        im_part1.subs({a: re_e, b: im_e}) + im_part3.subs({a: re_e, b: -im_e}))

    from sympy.functions.elementary.trigonometric import atan2, cos, sin

    if self.exp.is_Rational:
        re_e, im_e = self.base.as_real_imag(deep=deep)

        if im_e.is_zero and self.exp is S.Half:
            if re_e.is_extended_nonnegative:
                return self, S.Zero
            if re_e.is_extended_nonpositive:
                return S.Zero, (-self.base)**self.exp

        # XXX: This is not totally correct since for x**(p/q) with
        #      x being imaginary there are actually q roots, but
        #      only a single one is returned from here.
        r = self.func(self.func(re_e, 2) + self.func(im_e, 2), S.Half)

        t = atan2(im_e, re_e)

        rp, tp = self.func(r, self.exp), t*self.exp

        return rp*cos(tp), rp*sin(tp)
    elif self.base is S.Exp1:
        from sympy.functions.elementary.exponential import exp
        re_e, im_e = self.exp.as_real_imag()
        if deep:
            re_e = re_e.expand(deep, **hints)
            im_e = im_e.expand(deep, **hints)
        c, s = cos(im_e), sin(im_e)
        return exp(re_e)*c, exp(re_e)*s
    else:
        from sympy.functions.elementary.complexes import im, re
        if deep:
            hints['complex'] = False

            expanded = self.expand(deep, **hints)
            if hints.get('ignore') == expanded:
                return None
            else:
                return (re(expanded), im(expanded))
        else:
            return re(self), im(self)

sympy.sympy.core.symbol.as_real_imag:
def as_real_imag(self, deep=True, **hints) -> tuple[Expr, Expr]:
    # XXX: Remove the ignore flag
    if hints.get('ignore') == self:
        return None # type: ignore
    else:
        from sympy.functions.elementary.complexes import im, re
        return (re(self), im(self))

sympy.sympy.functions.elementary.complex:
def as_real_imag(self, deep=True, **hints):
    """
    Return the imaginary part with a zero real part.

    """
    return (self, S.Zero)

sympy.sympy.functions.elementary.hyperbo:
def as_real_imag(self, deep=True, **hints):
    if self.args[0].is_extended_real:
        if deep:
            hints['complex'] = False
            return (self.expand(deep, **hints), S.Zero)
        else:
            return (self, S.Zero)
    if deep:
        re, im = self.args[0].expand(deep, **hints).as_real_imag()
    else:
        re, im = self.args[0].as_real_imag()

    return (cosh(re)*cos(im), sinh(re)*sin(im))

sympy.sympy.functions.elementary.trigono:
def as_real_imag(self, deep=True, **hints):
    from sympy.functions.elementary.hyperbolic import cosh, sinh
    re, im = self._as_real_imag(deep=deep, **hints)
    return (cos(re)*cosh(im), -sin(re)*sinh(im))
